package main

import "fmt"

// 双指针
func lengthOfLongestSubstring(s string) int {
	min, max, count := 0, 0, 0
	m := make(map[uint8]int, len(s))

	for i := 0; i < len(s); i++ {
		if m[s[i]] > 0 {
			if max-min > count {
				count = max - min
			}

			if min < m[s[i]] {
				min = m[s[i]]
			}
		}

		max++
		m[s[i]] = i + 1
	}

	if max-min > count {
		count = max - min
	}

	return count
}

